import React from 'react';

export default function home(props) {
  return (
    <table class=' container table table-striped table-dark'>
      <tbody>
        <tr>
          <th scope='row'>1</th>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
      </tbody>
    </table>
  );
}
